, 0);\"\u003e\u003cspan style=\"background-color: rgb(255, 255, 255);\"\u003e\u003c/span\u003e\u003c/span\u003e\u003c/span\u003e---------------------------------------------------------------------\u003c/div\u003e\u003cdiv style=\"text-align: center;\"\u003e\u003cstrong style=\"background-color: initial;\"\u003e\u003cem\u003e\u003cspan style=\"background-color: rgb(0, 0, 0);\"\u003e\u003cspan style=\"color: rgb(255, 255, 255);\"\u003e\u00a0WHY PATREON?!\u00a0\u003c/span\u003e\u003c/span\u003e\u003c/em\u003e\u003c/strong\u003e\u003cbr\u003e\u003c/div\u003e\u003cdiv style=\"text-align: center;\"\u003eOver the past \u003ci style=\"font-weight: bold;\"\u003e4 YEARS \u003c/i\u003eI have been creating these intro edits to help people learn and gain confidence in mixing\u00a0\u003cem\u003eHIP-HOP / R\u0027N\u0027B \u003c/em\u003elive in their sets and help them expand their musical knowledge and skills as a DJ.\u00a0\u003cbr\u003e\u003c/div\u003e\u003cbr\u003e\u003cdiv style=\"text-align: center;\"\u003eAs you can imagine purchasing music, along with the many hours invested into making the edits for people to use ultimately costs money and going forward I will need the help from my fans to be able to provide the best quality product that I can!\u003cbr\u003e The goal with Patreon is to help funding with purchasing new music + resources to continue to release edits for people to use and help keep connected with all my sell outs from around the world!\u003cbr\u003e\u003cbr\u003eAnyone contributing will automatically earn access to a\u00a0\u003cspan style=\"background-color: rgb(229, 185, 183);\"\u003e\u003cem\u003especial\u00a0\u003c/em\u003e\u003cem\u003eplace\u00a0\u003c/em\u003e\u003cem\u003ein\u00a0\u003c/em\u003e\u003cem\u003emy\u00a0\u003c/em\u003e\u003cem\u003eheart\u00a0\u003c/em\u003e\u003c/span\u003e\u003cem\u003e\u003cspan style=\"background-color: rgb(229, 185, 183);\"\u003eforever\u003cspan style=\"background-color: rgb(255, 255, 255);\"\u003e\u00a0\u2764\u2764\
